import { makeStyles } from "@material-ui/core/styles";

const NavBarMakeStyle = makeStyles((theme) => ({
  root: {
    position: "fixed",
    // bottom: theme.spacing(2),
    // right: theme.spacing(6),
  },
}));

export default NavBarMakeStyle;
